@staticmethod

def _parse_from_url(argument: str) -> Optional[re.Match[str]]:

    link_regex = re.compile(

        r'https?://(?:(?:ptb|canary|www)\.)?discord(?:app)?\.com/channels/'

        r'(?:[0-9]{15,20}|@me)'

        r'/([0-9]{15,20})(?:/(?:[0-9]{15,20})/?)?$'

    )

    return link_regex.match(argument)
